import React from "react";
import { ScrollView, StyleSheet } from "react-native";
import { DataTable } from "react-native-paper";

const ScoreBoardScreen = () => {
  return (
    <ScrollView>
      <DataTable>
        <DataTable.Header>
          <DataTable.Title style={styles.dataTable}>Vivian</DataTable.Title>
          <DataTable.Title numeric>Fl√°vio</DataTable.Title>
          <DataTable.Title numeric>Sarita</DataTable.Title>
          <DataTable.Title numeric>Debora</DataTable.Title>
        </DataTable.Header>
      </DataTable>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  dataTable: {
    color: "white"
  }
});

export default ScoreBoardScreen;
